 - 5 ) , the in vitro effects on

<h2 style="margin: 0">4</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Role of the androgen receptor axis in prostate cancer . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P10275
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ( AR ) is expressed in nearly all prostate cancers , including treatment-refractory disease . The role of this receptor in the molecular endocrinology of prostate cancer has become increasingly clear in recent years . The AR is now known to participate in tumor progression through 3 mechanisms : expression ( activation and upregulation of receptor activity ) , point mutations , and ligand-independent activation . With regard to the latter mechanism , interleukin - 6 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P05231

</mark>
 ) is among the most important nonsteroidal regulators of AR activity . In the absence of androgen , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P05231

</mark>
 causes activation of AR that is approximately 50 % of the maximal activity induced by androgen . At low concentrations of androgen , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P05231
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and androgen synergistically activate AR . Nonsteroidal antiandrogens usually antagonize this activation , but they switch to an agonist effect in the presence of oncostatin M , an 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P05231
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - related cytokine . The growth of parental LNCaP cells is initially inhibited by exposure to 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 , but long-term treatment renders the cells resistant to such inhibition and confers a growth advantage . Both 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P05231
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and oncostatin M stimulate AR activity , but only oncostatin M is associated with strong acquisition of the agonist properties of nonsteroidal antiandrogens . It is hoped that continuing research on AR expression and function in prostate cancer will pave the way for new therapeutic strategies .</div>

<h2 style="margin: 0">5</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P10275
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 gene mutations in 46 , XY females with germ cell tumours . We present clinical findings and molecular characterization in two patients previously diagnosed as 46 , XY female gonadal dysgenesis with germ cell tumour . Both patients showed a female general phenotype with unambiguously female external genitalia and primary amenorrhoea compatible with complete androgen insensitivity syndrome . The first patient , at the age of 31 years , developed a dysgerminoma measuring 8 x 13 x 10 cm in one abdominal testis . Genetic analysis revealed a single nucleotide substitution on exon 4 in the hormone-binding domain of the androgen receptor ( AR ) gene , resulting in a change of codon 681 GAG ( glutamic acid ) to 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P29372

</mark>
 ( lysine ) . The second patient , at the age of 17 years , developed a dysgerminoma measuring 12 x 10 x 7 cm in one abdominal testis and gonadoblastoma in the other testis . Genetic analysis showed a point mutation on exon 3 in the DNA-binding domain of the AR gene resulting in a change of codon 607 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01215
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ( arginine ) to CAA ( glutamine ) . Arg 607 - Gln and Arg 608 - Lys point mutations in the DNA-binding domain of the AR gene have been associated with male breast cancer in partial androgen insensitivity syndrome . A codon 607 mutation in the DNA-binding domain of the AR gene in our patient 2 is associated with early development of germ cell tumour . We suggest regular molecular genetic analysis of the AR gene in 46 , XY females with germ cell tumour and androgen insensitivity syndrome to detect differences in the specific regions of AR gene involved in early progression toward oncogenesis of the dysgenetic gonads .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Discovery and role of methylidene imidazolone , a highly electrophilic prosthetic group . The elimination of ammonia from alpha-amino acids is a chemically difficult process . While the non-acidic beta-proton has to be abstracted , the much more acidic ammonium protons must remain untouched to maintain the leaving group ability of this positively charged group .

<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 has been solved . The electron density was not consistent with dehydroalanine but showed the presence of methylidene imidazolone ( Q9NP71 ) instead . The high electrophilicity of this prosthetic group as well as the geometry at the active site support a previously proposed mechanism involving a Friedel-Crafts-type attack at the aromatic ring of the substrate . Further biochemical evidence for this unprecedented electrophile-assisted ammonia elimination is also presented . Although no X-ray structure of Q9P2V4 has been published as yet , spectrophotometrical evidence for the presence of Q9NP71 has been provided . Finally , a chemical model for the Q9P2V4 reaction is described .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">DB02546 and bortezomib synergistically cause ubiquitinated protein accumulation in prostate cancer cells . PURPOSE : Protein ubiquitination is a novel strategy used to treat malignancies . We investigated whether the histone deacetylase inhibitor vorinostat ( Cayman Chemical , Ann Arbor , Michigan ) and the proteasome inhibitor bortezomib ( LC Laboratories , Woburn , Massachusetts ) would synergistically cause the accumulation of ubiquitinated proteins in prostate cancer cells . MATERIALS AND METHODS : LNCaP , PC - 3 and DU 145 cells ( ATCC  ) were treated with vorinostat and / or bortezomib . Cell viability and induction of apoptosis were assessed . In vivo efficacy was evaluated in a murine subcutaneous tumor model using PC - 3 cells . The influence of androgen receptor expression on bortezomib efficacy was examined using RNA interference . Changes in the expression of ubiquitinated proteins , cell cycle associated proteins and acetylated histone were evaluated . RESULTS : 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 expression seemed to decrease bortezomib activity . PC - 3 and DU 145 cells were more susceptible to bortezomib than LNCaP cells and the silencing of androgen receptor expression in LNCaP cells enhanced bortezomib activity . DB02546 and bortezomib synergistically induced apoptosis , inhibited prostate cancer cell growth and suppressed tumor growth in a murine xenograft model . The combination decreased cyclin D1 and cyclin-dependent kinase 4 expression , and increased 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P38936
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 expression . The combination synergistically caused the accumulation of ubiquitinated proteins and histone acetylation . This histone acetylation was a consequence of the accumulation of ubiquitinated proteins . CONCLUSIONS : DB02546 and bortezomib inhibit the growth of prostate cancer cells synergistically by causing ubiquitinated proteins to accumulate in cells . The current study provides a framework for testing the combination in patients with advanced prostate cancer .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">The role of tumor suppressor dysregulation in prostate cancer progression .

 and p53 protein . While such agents have undergone extensive study in many solid tumor types , the additional importance of

    P10275
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 rediscovered : the new biology and targeting the androgen receptor therapeutically . Discoveries over the past decade suggest that castration-resistant prostate cancer ( CRPC ) is sensitive , but not resistant to , further manipulation of the androgen-androgen receptor ( AR ) axis . Several new therapies that target this axis have demonstrated clinical activity . In this article , preclinical and clinical findings occurring in the field of AR-targeted therapies are reviewed . Reviews of scientific and clinical development are divided into those occurring prereceptor ( androgen production and conversion ) and at the level of the receptor ( AR aberrations and therapies targeting AR directly ) . Intracrine androgen production and AR amplification , among others , are among the principal aberrancies driving CRPC growth . Phase III data with abiraterone acetate and phase II data with 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB08899
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 , along with other similar therapies , confirm for the clinician that the scientific findings related to persistent AR signaling in a castrate milieu can be harnessed to produce significant clinical benefit for patients with the disease . Studies aimed at optimizing the timing of their use and exploring the mechanisms of resistance to these therapies are under way . The clinical success of therapies that directly target androgen synthesis as well as the most common aberrancies of the AR confirm that prostate cancer retains dependence on AR signaling , even in the castrate state .</div>

<h2 style="margin: 0">22</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Opioid and non-opioid

 - mediated predator-induced analgesia in mice and the effects of parasitic infection . The present study examined the nociceptive responses ( 50 degrees C , hot-plate ) of uninfected and subclinically parasitized male mice exposed to the odor of a predator , an ecologically relevant threatening stimulus . In uninfected mice a 15 - min exposure to 2 - propylthietane , the major component of weasel odor , induced a naloxone-reversible opioid analgesia . A 30 - s exposure elicited a shorter duration and lower amplitude ' non-opioid ' analgesia that was insensitive to naloxone , partially sensitive to either the serotonin - 1A (

 ) agonist , 8 - OH-DPAT , or the GABAA antagonist , bicuculline , and blocked by the competitive N-methyl-D-aspartate (

</mark>
 ) antagonist , NPC 12626 . In contrast , mice chronically ( 25 days ) and subclinically infected with the murine nematode , Heligmosomoides polygyrus , failed to show a significant non-opioid analgesia and displayed a markedly lower level of opioid analgesia than uninfected mice . These results suggest that 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB01221
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 receptor mechanisms are potently associated with the expression of the analgesia arising from exposure to the naturally aversive stimulus of predator odor . These findings also demonstrate that parasites , and likely other subchronic infections , can have a significant impact on the display of opioid and non-opioid stress-induced analgesia arising from exposure to the ethologically relevant stimulus of predator odor .</div>
